(3, ''payment_description'', ''<p>Анкета будет добавлена в “Дорогие девушки” и активирована в течении 24 часов после проверки администратором.</p>\r\n<p>Вы можете разместить анкету в “Дорогих девушках” при строгих условиях:<br/>\r\n1. Реальные высококачественные фото<br/>\r\n2. Стоимость услуг за час min 100$<br/>\r\nАдминистратор оставтяет за обой право отказать Вам в размещении, если не соблюдены условия</p>'', '''', '''', '''', '''', '''', '''', '''', 0, 1),
(4, ''real_photo'', ''<h6>Реальные фото</h6>\r\n<p>На сайте у Вас будет пометка Реальные фото.  Нам нужно убедиться что фото Ваши. </p>\r\n<p>Загрузите фото проверки: Ваше фото в полный рост с любым украинским журналом или газетой.</p>\r\n<p>Это фото нигде не афишируется и не выкладывается на сайте.</p>\r\n<p>Сугубо для проверки.</p>'', ''<h6> Real Photos </ h6>\r\n<p> The site you will mark real photos. We need to make sure that your photos. </ p>\r\n<p> Upload photos check: Your photos in a full-length with any Ukrainian magazine or newspaper. </ p>\r\n<p> This photo is not advertised anywhere else and are not laid out on the site. </ p>\r\n<p> Purely for verification. </ p>'', '''', '''', '''', '''', '''', '''', 0, 1),
(7, ''site_description'', ''<h2>Проститутки Одессы</h2>\r\n<p>Уже давно стоило бы в отчаянном порыве скинуть с себя ханжеские одежды, и трезвым взглядом взглянуть на окружающую реальность, для того, чтобы понять, что развитию рынка интимных услуг в Украине не в силах помешать никакие преграды и административные препоны властей. Секс индустрия уже давно ворвалась в сетевое пространство для того, чтобы стать одной из самых интересных и востребованных тем в мировой паутине.\r\nНа нашем портале собрана обширная информация по всем разделам рынка интимных услуг, в том числе и по такому занимательному разделу, как проститутки Одессы.\r\nВ этом городе, всегда славящимся огромным количеством аппетитных и азартных девушек, особенно бурно происходит развитие рынка сексуальных услуг. И мы абсолютно уверенны в том, что каждый заинтересованный в получении подобной услуги мужчина, сможет найти на наших страницах устраивающую его горячую украинскую девушку, исходя из собственных предпочтений о красоте и сексуальности.</p>\r\n<p>\r\nНа нашем сайте выставляют свои яркие, запоминающиеся на всю оставшуюся жизнь, фото. А также откровенные и зазывающие анкеты с контактными данными лакомых девочек, оцениваемых клиентурой, как самые сексапильные проститутки. Одесса, в этом смысле всегда считалась настоящим Клондайком на постсоветском, а уже позже и восточноевропейском пространстве. Уж простите, за сравнение, этакий Таиланд на побережье Черного Моря. Но куда там худосочным и кривоногим тайкам до наших Маришек и Наташек, которых природа на все 100% одарила формами, внешностью, характером, и, конечно же, трудолюбием и ненасытностью в сексуальных утехах. Именно последние два деловых, без преувеличения, качества испокон веком были визитной карточкой наших шалуний, которых принято величать бляди Одессы.</p>\r\n<p>\r\nНадеемся, что все помнят персонажей незабываемой советской комедии «Золотой теленок», Шуру Балаганова и Паниковского, реальные события которой, да и сами съемки происходили в Одессе