(325, 5, 0, 0, 237, ''Машенька и Тина'', ''Mashenka&Tina'', NULL, NULL, NULL, NULL, NULL, NULL, NULL, ''Мы ухожены,красивы и необычайно сексуальны-поэтому наши фото реальны и без фотошопа.Мы игривые и развратные кошечки,которые обожают дарить мужчинам изысканные ласки,наслаждаться прикосновениями мужского тела и рук;сливаясь в полном экстазе.Мы любим ласкать себя,когда на нас смотрят горящие восхищенные глаза мужчины.Машенька и Тина,мы приглашаем в наш райский уголок.С нетерпением ждем звоночка...'', ''We are well-kept, beautiful and extremely sexy, so our photos are real and without fotoshopa.My playful and naughty kitties who love to give men exquisite caress, enjoy the touch of a male body and hands, merging into a full ekstaze.My love to caress yourself when you look at us by thousands of admiring eyes muzhchiny.Mashenka and Tina, we invite you to our paradise ugolok.S look forward to bell ...\r\n'', NULL, NULL, NULL, NULL, NULL, 51, 1, 0, 21, 4, 177, ''+380509574811'', 500, 1000, 3500, NULL, NULL, NULL, 300, 0, NULL, NULL, NULL, NULL, NULL, ''2013-08-15 01:31:59'', 4, 4, ''2013-08-15 10:59:39'', 1, NULL, ''0000-00-00 00:00:00'', ''0000-00-00 00:00:00'', 0),
(293, 5, 43, 136, 153, ''Дарья'', ''Darya'', NULL, NULL, NULL, NULL, NULL, NULL, NULL, ''Приглашаю на дегустацию вкуснейшего коктейля из расслабляющего классического секса и тонизирующего анального! Оцени букет темперамента в сочетании с опытом.  С моей стороны - тактичное понимание необычных фантазий в обязательном порядке.Есть игрушки для меня и для тебя.'', '''', NULL, NULL, NULL, NULL, NULL, 41, 4, 0, 25, 2, 175, ''+380997792141'', 400, 800, 2400, 400, 800, 2400, 200, 0, NULL, -1, 1, NULL, ''51fd9ca264a30.jpg'', ''2013-08-04 03:13:22'', 4, 2, ''2013-08-09 05:42:17'', 1, NULL, ''0000-00-00 00:00:00'', ''0000-00-00 00:00:00'', 0),
