(298, 5, 43, 72, 153, ''Слава'', ''Slava'', NULL, NULL, NULL, NULL, NULL, NULL, NULL, ''Со мной легко и просто! Сексуальные фантазии, бешеный ритм - это полное наслаждение.Приезжай и очутись в моих жарких объятиях. Жду с нетерпением. Возможен выезд к Вам.Фото мои 100%.'', '''', NULL, NULL, NULL, NULL, NULL, 50, 2, 1, 18, 2, 167, ''+380637169883'', 400, 800, 2400, 400, 800, 2400, 200, 1, NULL, NULL, NULL, NULL, NULL, ''2013-08-04 03:32:57'', 2, 2, ''2013-08-04 20:03:43'', 1, NULL, ''0000-00-00 00:00:00'', ''0000-00-00 00:00:00'', 0),
(299, 5, 43, 72, 153, ''Иринка'', ''Irinka'', NULL, NULL, NULL, NULL, NULL, NULL, NULL, ''Самая обаятельная и привлекательная девушка ждет в гости состоятельных господ.Фото мои 100%.Не салон. Квартира под охраной. Деньги и ценности не храню.'', '''', NULL, NULL, NULL, NULL, NULL, 50, 1, 1, 20, 2, 170, ''+380996278699'', 400, 800, 2400, 400, 800, 2400, 200, 1, NULL, NULL, NULL, NULL, NULL, ''2013-08-04 03:39:20'', 2, 2, ''2013-08-04 06:10:25'', 1, NULL, ''0000-00-00 00:00:00'', ''0000-00-00 00:00:00'', 0),
(300, 5, 0, 0, 170, ''Маша'', ''Masha'', NULL, NULL, NULL, NULL, NULL, NULL, NULL, ''Искренняя. . . настоящая. . сексуальная. . . . . остальное узнаешь при встрече. . . звони '', '''', NULL, NULL, NULL, NULL, NULL, 49, 1, 0, 19, 2, 165, ''+380957904994'', 400, 800, 2400, 400, 800, 2400, NULL, 0, NULL, NULL, NULL, NULL, NULL, ''2013-08-04 08:17:24'', 2, 2, ''2013-08-04 08:19:03'', 1, NULL, ''0000-00-00 00:00:00'', ''0000-00-00 00:00:00'', 0),
(301, 5, 43, 52, 170, ''Милана'', ''Milana'', NULL, NULL, NULL, NULL, NULL, NULL, NULL, ''Стройная и нежная, словно орхидея, но удивительно темпераментная и способная на нетривиальные ласки. Посмотри на мои фото в анкете и потрясающее тело – тебе гарантированы самые разнообразные и чувственные удовольствия. Люблю показывать себя в жарком стриптизе, обольщать неординарным массажем и, конечно же, баловать потрясающим минетом. Подарю тебе незабываемый огонь страсти и пылкие наслаждения. '', '''', NULL, NULL, NULL, NULL, NULL, 52, 1, 0, 23, 2, 170, ''+380957906867'', 400, 800, 2400, 400, 800, 2400, NULL, 0, NULL, NULL, NULL, NULL, NULL, ''2013-08-04 08:23:14'', 1, 1, ''2013-08-04 08:23:14'', 1, NULL, ''0000-00-00 00:00:00'', ''0000-00-00 00:00:00'', 0),
